class LoginModelClass {  bool? status;  Msg? msg;  LoginModelClass({this.status, this.msg});  LoginModelClass.fromJson(Map<String, dynamic> json) {    status = json['status'];    msg = json['msg'] != null ? Msg.fromJson(json['msg']) : null;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['status'] = status;    if (msg != null) {      data['msg'] = msg!.toJson();    }    return data;  }}class Msg {  String? id;  String? tenantId;  String? userRole;  String? email;  String? token;  String? clientName;  Msg({this.id, this.tenantId, this.userRole, this.email, this.token, this      .clientName});  Msg.fromJson(Map<String, dynamic> json) {    id = json['id'];    tenantId = json['tenantId'];    userRole = json['userRole'];    email = json['email'];    token = json['token'];    clientName = json['clientName'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['id'] = id;    data['tenantId'] = tenantId;    data['userRole'] = userRole;    data['token'] = token;    data['email'] = email;    data['clientName'] = clientName;    return data;  }}